(155, 276, 'Page break example', 'page-break-example', '<p>Kus eu laoreet nunc. Tincidunt nulla a Nulla eu convallis scelerisque sociis nulla interdum et. Cursus senectus alique.Ty fames pede elit nibh at risus tempus.</p>\r\n<p>Vestibulum ante ipsum primis in faucibus orci luctus et ultrices posuere cubilia Curae; Maecenas libero odio, fringilla a elementum nec, iaculis a tortor. Praesent eget tortor leo. Cras bibendum mauris ut metus lacinia cursus. Aenean posuere diam quis quam aliquet nec dignissim orci convallis. Mauris molestie tincidunt convallis. Curabitur vestibulum vehicula erat eget placerat.Donec mattis, sapien id ornare interdum, orci nibh egestas nulla, at consectetur nunc libero eget nunc. Sed dignissim nisl at diam</p>\r\n<p>[clear]</p>\r\n<p>Kus eu laoreet nunc. Tincidunt nulla a Nulla eu convallis scelerisque sociis nulla interdum et. Cursus senectus alique.Ty fames pede elit nibh at risus tempus.</p>\r\n<hr title="Tabs 01" class="system-pagebreak" />\r\n<h3>Splitting a long Article into multiple linked pages</h3>\r\n<p>Splitting up long articles into sections is a helpful way of presenting content. Joomla! can be used to split Articles into multiple pages which are linked using Previous and Next page navigation and also a Table of Contents section which is displayed as part of the Article.</p>\r\n<ul class="yt-list type-smallnumber1">\r\n<li>Enter the <i>Page Title</i> and <i>Table of Contents Alias</i> as required:\r\n<ul class="yt-list type-disc">\r\n<li><b>Page Title</b>: Allows you to enter a sub title for the page displayed after the Article title. If left blank the main Article title will be used.</li>\r\n<li><b>Table of Contents Alias</b>: Used to give a shortened name for the Table of Contents which is displayed as part of multiple page Articles. If left blank the link will be displayed as <b>Page #</b>.</li>\r\n</ul>\r\n</li>\r\n<li>Click the <i>Insert Pagebreak</i> button. The screen will close and a horizontal rule will be inserted to show the location of the Pagebreak.\r\n<ul class="ytCircle2">\r\n<li>To close the Insert Pagebreak screen without inserting a Pagebreak click the <i>X</i> close button.</li>\r\n</ul>\r\n</li>\r\n<li>Repeat steps 2-5 for each Pagebreak required.\r\n<ul class="yt-list type-disc">\r\n<li>To remove a Pagebreak delete the horizontal rule using the delete or backspace keys.</li>\r\n</ul>\r\n</li>\r\n</ul>\r\n<p class="clearfix" style="clear: both;">It is not possible to edit the Page Title and Table of Contents Alias using the content editor once it has been inserted. To modify the Pagebreak you can do one of the following:</p>\r\n<ul>\r\n<li>Delete and re-insert the pagebreak using the process described above.</li>\r\n<li>Edit the raw HTML of the Article using the editor and modify the <b>title</b> and <b>alt</b> attributes of the relevant <b>&lt;hr&gt;</b> HTML tag.</li>\r\n</ul>\r\n<hr title="Tabs 02" class="system-pagebreak" />\r\n<p>Cras mattis consectetur purus sit amet fermentum. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante venenatis dapibus posuere velit aliquet. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec id elit non mi porta gravida at eget metus. Curabitur luctus tortor non quam gravida ultrices. In erat urna, tincidunt nec pulvinar ac, laoreet ut orci. Duis vestibulum, mi id malesuada pulvinar, arcu nibh facilisis augue, ut accumsan urna orci sagittis justo. Donec ut metus eros.</p>\r\n<p>Nulla at tortor et mauris accumsan adipiscing. Morbi pellentesque, dui ut blandit vehicula, lectus ligula aliquam nulla, sed mollis nunc odio at ipsum. Mauris scelerisque metus a justo facilisis ut semper ligula eleifend. Phasellus non odio nibh. Curabitur at tincidunt neque. Nunc euismod malesuada massa ac luctus. Pellentesque sed bibendum velit. Vivamus dictum pulvinar ipsum, vitae vestibulum eros ornare sit amet. Donec ut felis at sem auctor iaculis. Nullam hendrerit tempus tellus, ut fringilla diam vehicula quis. N