(157, 279, 'Blockquote', 'blockquote', '<p>For quoting blocks of content from another source within your document.</p>\r\n<h3>Default blockquote</h3>\r\n<p>Wrap <code>&lt;blockquote&gt;</code> around any <abbr title="HyperText Markup Language">HTML</abbr>\r\nas the quote. For straight quotes we recommend a <code>&lt;p&gt;</code>.</p>\r\n\r\n<div class="bs-docs-example">\r\n     [quote align="none" border="#666" color="#666" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     <P>Vestibulum id urna eu tortor hendrerit iaculis sit amet in ipsum. Cras tempus ultrices leo, tempus iaculis eros tempor non.\r\n     Aenean ac nisl molestie ligula placerat porta non cursus neque. Phasellus sagittis est at lorem tincidunt consequat.</P>\r\n</div>\r\n<pre class="prettyprint linenums">&#91;quote width="auto" align="none" border="#666" color="#666" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n</pre>\r\n\r\n<h3>Blockquote options</h3>\r\n<p>Style and content changes for simple variations on a standard blockquote.</p>\r\n<div class="bs-docs-example">\r\n     [quote width="45%" align="left" border="#666" color="#666" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     <P>Vestibulum id urna eu tortor hendrerit iaculis sit amet in ipsum. Cras tempus ultrices leo, tempus iaculis eros tempor non.\r\n     Aenean ac nisl molestie ligula placerat porta non cursus neque. Phasellus sagittis est at lorem tincidunt.</P>\r\n</div>\r\n<pre class="prettyprint linenums">&#91;quote width="45%" align="left" border="#666" color="#666" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n</pre>\r\n\r\n<div class="bs-docs-example">\r\n     [quote width="45%" align="right" border="#666" color="#666" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     <P>Vestibulum id urna eu tortor hendrerit iaculis sit amet in ipsum. Cras tempus ultrices leo, tempus iaculis eros tempor non.\r\n     Aenean ac nisl molestie ligula placerat porta non cursus neque. Phasellus sagittis est at lorem tincidunt.</P>\r\n</div>\r\n<pre class="prettyprint linenums">&#91;quote width="45%" align="right" border="#666" color="#666" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n</pre>\r\n\r\n<div class="bs-docs-example">\r\n     [quote align="none" border="#468847" color="#468847" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     [quote align="none" border="#F89406" color="#F89406" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     [quote align="none" border="#B24745" color="#B24745" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n     [quote align="none" border="#3A87AD" color="#3A87AD" title="Someone famous in Source Title"]\r\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere erat a ante.\r\n     [/quote]\r\n</div>\r\n<pre class="prettyprint linenums">&#91;quote align="none" border="#468847" color="#468847" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n&#91;quote align="none" border="#F89406" color="#F89406" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n&#91;quote align="none" border="#B24745" color="#B24745" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&#93;\r\n&#91;quote align="none" border="#3A87AD" color="#3A87AD" title="SOMEONE_FAMOUS_TITLE"&#93; ADD_CONTENT_HERE &#91;/quote&