(158, 280, 'List Style', 'list-style', '<h3>Unordered lists</h3>\r\n<p>A list of items in which the order does <em> not </em> explicitly matter.</p>\r\n<div class="row">\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="disc"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="disc"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="circle"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="circle"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="square"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="square"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&#91;/list&#93;\r\n</pre>\r\n</div>\r\n</div>\r\n<div class="row">\r\n<div class="col-lg-4">\r\n<div class="bs-docs-example">[list type="check"]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[list_item]Lorem ipsum dolor sit amet[/list_item]\r\n[/list]</div>\r\n<pre class="prettyprint linenums">&#91;list type="check"&#93;\r\n&#91;list_item&#93; ... &#91;/list_item&#93\r\n&