(164, 286, ' Message Box ', 'message-box', '<p>Add dismiss functionality to all alert messages with this plugin.</p>\r\n<div class="bs-docs-example">\r\n[message_box type="error" close="Yes"]<strong>ERROR !  </strong> Lorem ipsum dolor sit amet, consectetur adipiscing elit[/message_box]\r\n[message_box type="info" close="Yes"]<strong> INFO !  </strong> Lorem ipsum dolor sit amet, consectetur adipiscing elit[/message_box]\r\n[message_box type="warning" close="Yes"]<strong>WARNING !  </strong> Lorem ipsum dolor sit amet, consectetur adipiscing elit[/message_box]\r\n[message_box type="success" close="Yes"]<strong>SUCCESS !  </strong> Lorem ipsum dolor sit amet, consectetur adipiscing elit[/message_box]\r\n\r\n</div>\r\n<pre class="prettyprint linenums">\r\n&#91;message_box type="error"   close="Yes"&#93; ADD_CONTENT_HERE &#91;/message_box&#93;\r\n&#91;message_box type="info"    close="Yes"&#93; ADD_CONTENT_HERE &#91;/message_box&#93;\r\n&#91;message_box type="warning" close="Yes"&#93; ADD_CONTENT_HERE &#91;/message_box&#93;\r\n&#91;message_box type="success" close="Yes"&#93; ADD_CONTENT_HERE &#91;/message_box&#93;\r\n</pre>\r\n\r\n<!----------------------- Block space-------------------->\r\n<div class="bs-docs-example">\r\n[message_box title="Oh snap! You got an error!" type="error" close="Yes"]\r\nChange this and that and try again. Duis mollis, est non commodo luctus, nisi erat porttitor ligula,\r\neget lacinia odio sem nec elit. Cras mattis consectetur purus sit amet fermentum.\r\n[/message_box]\r\n\r\n</div>\r\n<pre class="prettyprint linenums">\r\n&#91;message_box title=''MESSAGE_TITLE'' type="error" close="Yes"&#93; ADD_CONTENT_HERE &#91;/message_box&#93;\r\n</pre>', '', 1, 90, '2013-02-21 23:07:00', 684, '', '2013-04-01 06:57:03', 42, 0, '0000-00-00 00:00:00', '2013-02-21 23:07:00', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":null,"urlatext":"","targeta":"","urlb":null,"urlbtext":"","targetb":"","urlc":null,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_intro":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 4, 22, '', '', 1, 47, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(165, 287, 'Social Buttons', 'social-buttons', '[message_box type="warning" close="no"]\r\n<p>Ex: element type="facebook" then name of icons is "fa-facebook".</p>\r\nYou can find the full examples of usage at Font Awesome - <a href="http://fortawesome.github.io/Font-Awesome/icons/" target="_blank">Font Awesome 4.1.0</a> \r\n[/message_box]\r\n\r\n<div class="bs-docs-example">\r\n<p>\r\n[social type="facebook" title="Facebook Fllow Us" ] #[/social]\r\n[social type="twitter" ]#[/social]\r\n[social type="google-plus"]#[/social]\r\n[social type="pinterest" ]#[/social]\r\n[social type="dribbble" ]#[/social]\r\n\r\n[social type="flickr" title="Follow us on Flickr"]#[/social]\r\n[social type="linkedin" title="Follow us on Linkedin"]#[/social]\r\n[social type="rss" title="Follow us on Rss"]#[/social]\r\n[social type="skype" title="Follow us on Skype"]#[/social]\r\n[social type="youtube" title="Follow us on Youtube"]#[/social]\r\n\r\n</p>\r\n</div>\r\n<pre class="prettyprint linenums">\r\n&#91;social type="facebook"&#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="twitter"&#93; PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="google-plus"&#93;      PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="pinterest"&#93;       PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="dribbble"&#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n\r\n&#91;social type="flickr" title="ADD_TITLE_HERE" &#93;  PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="linkedin" title="ADD_TITLE_HERE" &#93;     PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="rss" title="ADD_TITLE_HERE" &#93;      PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="skype" title="ADD_TITLE_HERE" &#93;    PLACE_LINK_HERE &#91;/social&#93;\r\n&#91;social type="youtube" title="ADD_TITLE_HERE" &#93; PLACE_LINK_HERE &#91;/social&#93;\r\n\r\n</pre>\r\n\r\n<!----------------------- Block space Min-------------------->\r\n\r\n<div class="bs-docs-example">\r\n[social type="facebook" style="min"]#[/