(198, 397, 'Tooltip', 'tooltip', '<div class="bs-docs-example">\r\n Nulla ac convallis ipsum. Nulla tellus erat, [tooltip link="#" title="Nulla ac convallis ipsum" position="top"] venenatis  [/tooltip] in auctor quis, aliquet a magna. Ut tortor nisl;\r\n pellentesque a rhoncus non, semper a quam. Sed [tooltip link="#" title="Nulla ac convallis ipsum" position="top"] aliquet  [/tooltip] libero at lorem ornare auctor ornare est condimentum.\r\n  Morbi pulvinar nibh egestas massa venenatis sed   [tooltip link="#" title="Nulla ac convallis ipsum" position="top"] condimentum  [/tooltip] turpis suscipit. In hac habitasse platea dictumst.\r\n    [tooltip link="#" title="Nulla ac convallis ipsum" position="top"] Quisque quis odio a odio porttitor  [/tooltip]  mattis! Donec id elit nec massa ornare dictum.\r\n  \r\n</div>\r\n  \r\n<pre class="prettyprint linenums">&#91;tooltip link="#" title=''TITLE'' position=''top''&#93;ADD_CONTENT_HERE &#91;tooltip&#93;\r\n</pre>\r\n\r\n[space height="10"]\r\n<div class="bs-docs-example">\r\n [space height="10"]\r\n  [button  link=''#'' title=''Click here example Tooltip'' position=''top'' type=''warning'']Tooltip on top[/button]\r\n [button  link=''#'' title=''Click here example Tooltip'' position=''left'' type=''primary'']Tooltip on left[/button]\r\n [button  link=''#'' title=''Click here example Tooltip'' position=''right'' type=''info'']Tooltip on right[/button]\r\n [button  link=''#'' title=''Click here example Tooltip'' position=''bottom'' type=''success'']Tooltip on bottom[/button]\r\n  [space height="30"]\r\n</div>\r\n  \r\n<pre class="prettyprint linenums">&#91;button  link=''#'' title=''TITLE'' position=''top|right|bottom|left'' type=''warning''&#93;ADD_CONTENT_HERE[&#91;/button&#93;\r\n&#91;button  link=''#'' title=''TITLE'' position=''top|right|bottom|left'' type=''primary''&#93;ADD_CONTENT_HERE[&#91;/button&#93;\r\n&#91;button  link=''#'' title=''TITLE'' position=''top|right|bottom|left'' type=''info''&#93;ADD_CONTENT_HERE[&#91;/button&#93;\r\n&#91;button  link=''#'' title=''TITLE'' position=''top|right|bottom|left'' type=''success''&#93;ADD_CONTENT_HERE[&#91;/button&#93;\r\n</pre>\r\n\r\n<h4>Customization Options / Features</h4>\r\n\r\n<ul>\r\n<li><strong>Link :</strong> Link for website</li>\r\n<li><strong>Position : </strong> Select position align (top, bottom,left,right)</li>\r\n<li><strong>Type :</strong>  Select type color (warning, primary, info, success)  </li>\r\n<li><strong>Title :</strong> Text in tooltip </li>\r\n</ul>', '', 1, 90, '2014-05-29 07:21:34', 684, '', '2014-05-29 09:01:25', 558, 0, '0000-00-00 00:00:00', '2014-05-29 07:21:34', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","show_urls_images_frontend":""}', 2, 5, '', '', 1, 22, '{"robots":"","author":"","rights":"","xreference":""}', 0, '*', ''),
(199, 401, 'On scroll animations ', 'on-scroll-animations', ' <p>In the SJ Plus v2 template we have implemented the animation engine based on the <a target="_blank" href="http://julianlloyd.me/scrollreveal/">scrollReveal.js script</a>. This script makes creating elements onscroll animations very simple to define.</p>\r\n\r\n<p>Thanks to this script you can describe an animation using natural language.</p>\r\n\r\n<p>Description of the animation is placed in the <strong>data-scroll-reveal</strong> attribute:</p>\r\n\r\n<pre>&lt;!-- These 3 lines are equivalent --&gt;\r\n&lt;div data-scroll-reveal="enter left and move 50px over 1.33s"&gt; Foo &lt;/div&gt;\r\n&lt;div data-scroll-reveal="enter from the bottom after 1s"&gt; Bar &lt;/div&gt;\r\n&lt;div data-scroll-reveal="wait 2.5s and then ease-in-out 100px"&gt; Baz &lt;/div&gt;\r\n</pre>\r\n\r\n<p>The full description of the syntax is available on the project <a target="_blank" href="https://github.com/julianlloyd/scrollReveal.js">documentation page</a></p>   		              		            ', '', 1, 91, '2014-07-31 12:05:20', 684, '', '2014-07-30 14:13:55', 558, 0, '0000-00-00 00:00:00', '2014-07-31 12:05:20', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options